// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

// ==================== External Imports ====================

import {AccessControl} from "@openzeppelin/contracts/access/AccessControl.sol";

// ==================== Internal Imports ====================

import {IPixelCoin} from "./interfaces/IPixelCoin.sol";
import {ICanvasManagerV2} from "./interfaces/ICanvasManagerV2.sol";

import {PixNft} from "./PixNft.sol";

/**
 * @title NftReward
 * @author Matrix
 */
contract NftReward is AccessControl {
    // ==================== Constants ====================

    bytes32 public constant ADMIN_ROLE = keccak256("ADMIN_ROLE");

    // ==================== Variables ====================

    ICanvasManagerV2 internal immutable _canvas;
    PixNft internal immutable _pixNft;
    IPixelCoin internal immutable _pixelCoin;

    uint256 internal _defaultRewardPerNft; // default reward per NFT
    mapping(uint256 => uint256) internal _rewardOfNft; // tokenId => reward per NFT
    mapping(uint256 => mapping(address => bool)) internal _isClaimed; // tokenId => account => whether claimed

    // ==================== Events ====================

    event NewNftReward(address indexed canvas, address indexed pixNft, address indexed pixelCoin);
    event SetDefaultRewardPerNft(uint256 oldDefaultReward, uint256 newDefaultReward);
    event SetReward(uint256 indexed nftId, uint256 reward);
    event Claim(uint256 indexed nftId, address indexed contributor, uint256 amount);

    // ==================== Constructor function ====================

    constructor(
        address canvas,
        address pixNft,
        address pixelCoin
    ) {
        require(canvas != address(0), "zero canvas");
        require(pixNft != address(0), "zero pixNft");
        require(pixelCoin != address(0), "zero pixelCoin");

        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(ADMIN_ROLE, _msgSender());

        _canvas = ICanvasManagerV2(canvas);
        _pixNft = PixNft(pixNft);
        _pixelCoin = IPixelCoin(pixelCoin);

        emit NewNftReward(canvas, pixNft, pixelCoin);
    }

    // ==================== Modifier functions ====================

    modifier onlyAdmin() {
        _onlyAdmin();
        _;
    }

    // ==================== External functions ====================

    function getCanvas() external view returns (address) {
        return address(_canvas);
    }

    function getPixNft() external view returns (address) {
        return address(_pixNft);
    }

    function getPixelCoin() external view returns (address) {
        return address(_pixelCoin);
    }

    function getDefaultRewardPerNft() external view onlyAdmin returns (uint256) {
        return _defaultRewardPerNft;
    }

    function setDefaultRewardPerNft(uint256 newDefaultRewardPerNft) external onlyAdmin {
        uint256 oldDefaultRewardPerNft = _defaultRewardPerNft;
        _defaultRewardPerNft = newDefaultRewardPerNft;

        emit SetDefaultRewardPerNft(oldDefaultRewardPerNft, newDefaultRewardPerNft);
    }

    function getClaimeInfo(uint256 nftId, address contributor) external view returns (bool isClaimed, uint256 amount) {
        (uint256 individualShares, uint256 totalShares) = _canvas.getShares(nftId, contributor);
        uint256 rewardOfNft = (_rewardOfNft[nftId] == 0) ? _defaultRewardPerNft : _rewardOfNft[nftId];

        isClaimed = _isClaimed[nftId][contributor];
        amount = (rewardOfNft * individualShares) / totalShares;
    }

    function claim(uint256 nftId, address contributor) external {
        _pixNft.ownerOf(nftId); // this function checks nonexistent token

        require(!_isClaimed[nftId][contributor], "already claimed");
        _isClaimed[nftId][contributor] = true;

        (uint256 individualShares, uint256 totalShares) = _canvas.getShares(nftId, contributor);
        require(individualShares > 0, "no contribution");

        uint256 rewardOfNft = _rewardOfNft[nftId];
        if (rewardOfNft == 0) {
            uint256 defaultReward = _defaultRewardPerNft;
            require(defaultReward > 0, "no NFT reward now");

            rewardOfNft = defaultReward;
            _rewardOfNft[nftId] = defaultReward;

            emit SetReward(nftId, rewardOfNft);
        }

        uint256 amount = (rewardOfNft * individualShares) / totalShares;
        _pixelCoin.mint(contributor, amount);

        emit Claim(nftId, contributor, amount);
    }

    // ==================== Private functions ====================

    function _onlyAdmin() private view {
        require(hasRole(ADMIN_ROLE, _msgSender()), "not admin");
    }
}
